import {product} from '../data';
import Cards from './Cards';

const Product = () => {
  // product data
  const {title, subtitle} = product;
  return <section>
    <div className="container mx-auto">
    {/*  title and subtitle*/}
      <div>
        <h2>{title}</h2>
      </div>
    </div>
  </section>;
};

export default Product;
